CREATE NONCLUSTERED INDEX IX_MovimentacaoEstoqueProduto_IdTipoMovimentacao ON MovimentacaoEstoqueProduto (IdTipoMovimentacao);

-- Tabela MovimentacaoEstoqueMateriaPrima
CREATE NONCLUSTERED INDEX IX_MovimentacaoEstoqueMateriaPrima_IdEstoqueProduto ON MovimentacaoEstoqueMateriaPrima (IdEstoqueMateriaPrima);
CREATE NONCLUSTERED INDEX IX_MovimentacaoEstoqueMateriaPrima_DataMovimentacao ON MovimentacaoEstoqueMateriaPrima (DataMovimentacao);
CREATE NONCLUSTERED INDEX IX_MovimentacaoEstoqueMateriaPrima_IdTipoMovimentacao ON MovimentacaoEstoqueMateriaPrima (IdTipoMovimentacao);

        DECLARE @Pagina INT = 0,
                @Quantidade INT = 10

            SELECT  pr.Id,
                    pr.Nome,
                    COUNT(p.Id) AS VezesComAtrasoProd
                FROM [dbo].[Producao] p WITH(NOLOCK)
                    INNER JOIN [dbo].[EtapaProducao] ep WITH(NOLOCK)
                        ON  ep.Id = p.IdEtapaProducao
                    INNER JOIN [dbo].[Produto] pr WITH(NOLOCK)
                        ON pr.Id = ep.IdProduto
            WHERE DATEDIFF(MINUTE, p.DataInicio, p.DataTermino) > ep.Duracao
            GROUP BY pr.Id, pr.Nome
            ORDER BY VezesComAtrasoProd DESC
            OFFSET ((@Quantidade - 1) * @Pagina) ROWS
            FETCH NEXT @Quantidade ROWS ONLY


        DECLARE @DataAtual DATETIME = GETDATE()
        
        SELECT  COUNT(pr.IdEtapaProducao) AS QuantidadeAtrasos,
                ep.Id AS IdEtapa
            FROM Producao pr WITH(NOLOCK)
                INNER JOIN PedidoProduto pp WITH(NOLOCK)
                    ON pp.Id = pr.IdPedidoProduto
                INNER JOIN EtapaProducao ep WITH(NOLOCK)
                    ON ep.Id = pr.IdEtapaProducao
            WHERE DATEDIFF(MINUTE, pr.DataInicio, @DataAtual) > ep.Duracao
                AND pr.DataTermino IS NULL
                OR DATEDIFF(MINUTE, pr.DataInicio, pr.DataTermino) > ep.Duracao
            GROUP BY ep.Id
            ORDER BY QuantidadeAtrasos DESC